Backbone.Router=Backbone.Router.extend({initialize:function(){var t=this;this.on("route",function(e){if(t.titles)if(t.titles[e])document.title=t.titles[e];else{if(!t.titles.default)throw"Backbone.js Router Title Helper: No title found for route:"+e+" and no default route specified.";document.title=t.titles.default}})}});